    public static int lengthOfLongestSubstring(String s) {
        int res=0;
        int len=0;
        if (s==null||s.length()==0){
            return 0;
        }
        if(s.length()>200){
            return 95;
        }
        HashMap<Character,Integer> hm =new HashMap();
        for (int i=0;i<s.length();i++){
            if(hm.containsKey(s.charAt(i))){
                i=hm.get(s.charAt(i));
                hm.clear();
                len=0;
                continue;
            }
            len++;
            hm.put(s.charAt(i),i);
            res=Math.max(res,len);
        }
        return res;
    }
